Structural characteristics:
Ratio of body length/width: males 1.94; females 1.83. Head, on average, slightly narrower than pronotal width, synthlipsis 1.7 times as wide as posterior width of eye. Ocular index: males 1.80; females 1.67. General facies of head (vertex, frons, and labium) short. Third antennal segment densely pilose, long, elliptical, with apex broadly rounded; segments one and two very short. Pronotum very short in brachypters (
Figs. 1a–b
), tapering laterally, apical margin nearly straight. Pronotum in macropterous form (
Figs. 1c–d
) elliptical, widened medially and tapering laterally. Pronotum in brachypters averaging six times as wide as long (W/L: males 0.78/0.13; females 0.79/0.16). In macropters, pronotum considerably larger, proportionate, averaging three to four times as wide as long (W/L: males 1.04/0.35; females 1.03/0.21). Prothoracic lobe narrowed and long (
Fig. 2a
), anterior margin straight, posterior and lower margins rounded. Hemelytra with dense linear microsculpturing especially produced on the clavi. Hemelytral setae robust and uniformly distributed. Surface of head with dense microsculpturing, pronotum with ill-developed pitting, hemelytra more or less smooth. Lateral spines on abdominal segments IV–VIII: IV: one stout, short spine, two thin, long setae; V: two stout, short setae, one long, stout seta, one long, thin seta; VI: three stout, short setae, one long, thin seta; VII: five short, stout spines, one longer, stout spine; VIII: five stout, short spines, two long, thin setae. Metaxyphus of both sexes short, broad, acutely triangular, apex acuminate (
Fig. 2b
).

Male foreleg (
Fig. 2c
): femur with two short, stout spines in basal third near ventral surface, two additional spines near ventral surface of base. Tibia with two longer spines in apico-dorsal portion and one short spine near apico-ventral surface. Pala with four long setae dorsally; palmar area with 14–15 ill-developed setae in upper row, 17–18 setae in lower row. Apex of pala with a short thickened seta. Palar claw (
Fig. 2d
) elongate, broadest medially, apex rounded. Female foreleg with same general setal arrangement as male. Mesotarsal claws short, equaling about one-fifth the length of the mesotarsus.

Lateral lobes of abdominal tergum IV comparatively broad, rounded apically. Right lobe slightly broader and longer, with 13–16 long setae, left lobe shorter, with 6–8 long evenly spaced, apically placed setae. Prestrigilar flap of tergal segment V as in 
Figure 2e
. Strigil very small, elongate and elliptical, with few combs. Median lobe of sternite VII (
Fig. 2f
) short, broad, with four longer setae restricted sub-basally, apex acuminate. Free lobe of tergite VIII (

Fig. 
2g

) broad, nearly quadrate with inner angle rounded. Inner angle with 16–18 setae of varying lengths. Pars stridens processus cleaner ridges of tergite VIII not examined. Male left paramere (
Figs. 3d–e, g
) short, shaft curved and parallel-sided, apical portion reduced and ribbon-like (
Figs. 3d–e
). Paramere base broad, hatchetshaped, lower portion of base broadly rounded (
Figs. 3d, g
). Right paramere (
Figs. 3d–g
) long, parallel-sided, tip tapering to bluntly rounded point (
Fig. 3e
). Base of right paramere long, lower portion rounded, with about 33–36 plectral ribs confined to medial portion (
Fig. 3h
). Aedeagus broad, as in 
Figures 3d–g
.
